import { useState } from "react";
import "./App.css";

function Navbar({ currentSection, setCurrentSection }) {
  return <nav>// Navbar component code</nav>;
}

function Home() {
  return <section>{/* Home component code */}</section>;
}

function Hobby() {
  return <section>{/* Hobby component code */}</section>;
}

function Movies() {
  return <section>{/* Movies component code */}</section>;
}

function Interest() {
  return <section>{/* Interest component code */}</section>;
}

function Contact() {
  return <section>{/* Contact component code */}</section>;
}

function Footer() {
  return <footer>{/* Footer component code */}</footer>;
}

function App() {
  const [currentSection, setCurrentSection] = useState("home");

  return (
    <>
      <Navbar
        currentSection={currentSection}
        setCurrentSection={setCurrentSection}
      />

      <main>
        <Home />

        {currentSection === "about" && <Hobby />}

        {currentSection === "movies" && <Movies />}

        {currentSection === "interest" && <Interest />}

        {currentSection === "contact" && <Contact />}
      </main>

      <Footer />
    </>
  );
}

export default App;
